import React from 'react'

const Table2 = ({ data }) => {
    return (
      <table>
        <tbody>
          <tr>
            {/* <th>Image</th>
            <th>Name</th>
            <th>Surname</th>
            <th>Email</th> */}
          </tr>
          {data.map((item) => (
            <tr key={item.id}>
            <td><img src={item.imageSrc} alt={`${item.first_name}`} /></td>
              {/* <td>{item.first_name}</td> */}
              {/* <td>{item.last_name}</td> */}
              
            </tr>
          ))}
        </tbody>
      </table>
    );
  };


  function renderImageRows() {
    const rows = [];
  
    for (let i = 0; i < 5; i++) {
      rows.push(
        <tr key={i}>
          {renderImageCells()}
        </tr>
      );
    }
  
    return rows;
  }
  
  function renderImageCells() {
    const cells = [];
  
    for (let i = 0; i < 5; i++) {
      const imageUrl = `https://via.placeholder.com/50x50?text=Image${i}`;
      cells.push(
        <td key={i}>
          <img src={imageUrl} alt={`Image ${i}`} style={{ width: 50, height: 50 }} />
        </td>
      );
    }
  
    return cells;
  }
  
  export default Table2;
